# The first derivative of the density for DMGS
def gev_p1_f1fa(x,t0,v1,v2,v3,v4):
	v4 = cp_utils.movexiawayfromzero(v4)
	f1 = gev_p1_fd(x,t0,v1,v2,v3,v4)
	return f1

# The first derivative of the density for WAIC, vectorized t
def gev_p1_f1fw(x,t,v1,v2,v3,v4):
	v4=cp_utils.movexiawayfromzero(v4)
	f1=gev_p1_fd(x,t,v1,v2,v3,v4)
	return f1

# The second derivative of the density for DMGS
def gev_p1_f2fa(x,t0,v1,v2,v3,v4):
	v4=cp_utils.movexiawayfromzero(v4)
	temp1=gev_p1_fdd(x,t0,v1,v2,v3,v4)
	return temp1

# The second derivative of the density for WAIC, vectorised t
def gev_p1_f2fw(x,t,v1,v2,v3,v4):
	v4=cp_utils.movexiawayfromzero(v4)
	temp1=gev_p1_fdd(x,t,v1,v2,v3,v4)
	return temp1

# Minus the first derivative of the cdf, at alpha
def gev_p1_mu1fa(alpha,t0,v1,v2,v3,v4):
	x=genextreme.ppf((1-alpha),-v4,loc=v1+v2*t0,scale=v3)
	v4=cp_utils.movexiawayfromzero(v4)
	mu1=-gev_p1_pd(x,t0,v1,v2,v3,v4)
	return mu1

# Minus the second derivative of the cdf, at alpha
def gev_p1_mu2fa(alpha,t0,v1,v2,v3,v4):
	x=genextreme.ppf((1-alpha),-v4,loc=v1+v2*t0,scale=v3)
	v4=cp_utils.movexiawayfromzero(v4)
	temp1=gev_p1_pdd(x,t0,v1,v2,v3,v4)
	return -temp1

# The second derivative of the normalized log-likelihood; vectorised t
def gev_p1_ldda(x,t,v1,v2,v3,v4):
	v4=cp_utils.movexiawayfromzero(v4)
	temp1=gev_p1_logfdd(x,t,v1,v2,v3,v4)
	ldd=np.sum(temp1,axis=-1)/len(x)
	return ldd

# The third derivative of the normalized log-likelihood, vectorised t
def gev_p1_lddda(x,t,v1,v2,v3,v4):
	v4=cp_utils.movexiawayfromzero(v4)
	temp1=gev_p1_logfddd(x,t,v1,v2,v3,v4)
	lddd=np.sum(temp1,axis=-1)/len(x)
	return(lddd)
